import { loadCategoriesAction } from './Categories_reducer/Categories_reducer'
import { loadProductsAction } from './Products_reducer/Products_reducer'

export const getCategories = callback => {
    // fetch('http://localhost:3333/categories/all')
    fetch('https://fakestoreapi.com/products/categories')
    .then(res => res.json())
    .then(res => callback(loadCategoriesAction(res)))
}

export const getProductsByCategory = callback => {
    fetch('https://fakestoreapi.com/products/category/jewelery')
        .then(res=>res.json())
        .then(json=>callback(loadProductsAction(json)))
}
